import React from "react";
import { Box, Typography } from "@mui/material";

const auth = () => {
  return (
    <div>
      <form>
        <Box display="flex" flexDirection={"column"}>
          <Typography variant="h1">This is a Form</Typography>
        </Box>
      </form>
    </div>
  );
};

export default auth;
